import Content from "../contents/Content";
import Nav from "../navbar/Nav";
import "./Order.css";
function Order() {
  return (
    <>
      <Nav />
      <div className="ordersideCard">
        <div className="ordertext2">
          <p className="ordermaintxt">37</p>
          <p className="ordersubtxt">Interactive quizzes</p>
          <br />
          <p className="ordermaintxt">265+</p>
          <p className="ordersubtxt">Concepts and exercises</p>
          <br />
          <br />
          <button className="orderbtnx">Start Course</button>
        </div>
      </div>
      <Content notindex={-1} />
    </>
  );
}
export default Order;
